import * as React from 'react';
import { styled } from '@mui/material/styles';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell, { tableCellClasses } from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

import vector from '../../assets/images/icons/Vector.svg';
import close from '../../assets/images/icons/Delete.svg';

const StyledTableCell = styled(TableCell)(({ theme }) => ({
	[`&.${tableCellClasses.head}`]: {
		backgroundColor: theme.palette.common.black,
		color: theme.palette.common.white,
	},
	[`&.${tableCellClasses.body}`]: {
		fontSize: 14,
	},
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
	'&:nth-of-type(odd)': {
		backgroundColor: theme.palette.action.hover,
	},
	// hide last border
	'&:last-child td, &:last-child th': {
		border: 0,
	},
}));

function createData(name, store, address, category, date, price, remains, weight) {
	return { name, store, address, category, date, price, remains, weight };
}

const rows = [
	createData('Frozen yoghurt', 159, 6.0, 24, 4.0),
	createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
	createData('Eclair', 262, 16.0, 24, 6.0),
	createData('Cupcake', 305, 3.7, 67, 4.3),
	createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const ProductTable = () => {
	return (
		<TableContainer component={Paper}>
			<Table sx={{ minWidth: 700 }} aria-label="customized table">
				<TableHead>
					<TableRow>
						<StyledTableCell>Product name</StyledTableCell>
						<StyledTableCell align="center">Store</StyledTableCell>
						<StyledTableCell align="right">address</StyledTableCell>
						<StyledTableCell align="right">Category</StyledTableCell>
						<StyledTableCell align="right">Creation date</StyledTableCell>
						<StyledTableCell align="right">Price</StyledTableCell>
						<StyledTableCell align="right">Remains</StyledTableCell>
						<StyledTableCell align="right">Weight / Volume</StyledTableCell>
						<StyledTableCell align="center">Actions</StyledTableCell>
					</TableRow>
				</TableHead>
				<TableBody>
					{rows.map((row) => (
						<StyledTableRow key={row.name}>
							<StyledTableCell component="th" scope="row">
								{row.name}
							</StyledTableCell>
							<StyledTableCell align="center">{row.store}</StyledTableCell>
							<StyledTableCell align="right">{row.address}</StyledTableCell>
							<StyledTableCell align="right">{row.category}</StyledTableCell>
							<StyledTableCell align="right">{row.date}</StyledTableCell>
							<StyledTableCell align="right">{row.price}</StyledTableCell>
							<StyledTableCell align="right">{row.remains}</StyledTableCell>
							<StyledTableCell align="right">{row.weight}</StyledTableCell>
							<StyledTableCell align="center">
								<div className="btn">
									<span>Sell</span>
								</div>
								<div className="btn ">
									<img src={vector} alt="Edit"/>
								</div>
								<div>
									<img src={close} alt="Close"/>
								</div>
							</StyledTableCell>
							{/*<StyledTableCell align="right">*/}
							{/*	<TableCell align="right">*/}
							{/*		<div className="btn">*/}
							{/*			<span>Sell</span>*/}
							{/*		</div>*/}
							{/*		<div className="btn ">*/}
							{/*			<img src={vector} alt="Edit"/>*/}
							{/*		</div>*/}
							{/*		<div>*/}
							{/*			<img src={close} alt="Close"/>*/}
							{/*		</div>*/}
							{/*	</TableCell>*/}
							{/*</StyledTableCell>*/}
						</StyledTableRow>
					))}
				</TableBody>
			</Table>
		</TableContainer>
	);
}
export default ProductTable;
